YaHei&#39;; font-size: 24px;\\\\\">企业简介</span></strong><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\"><br/></span></p><p style=\\\\\"text-indent: 2em; line-height: 2em;\\\\\"><strong><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 24px;\\\\\"><br/></span></strong></p><p style=\\\\\"text-indent: 2em; line-height: 2em; text-align: right;\\\\\"><strong><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 24px;\\\\\"><img src=\\\\\"[!--news.url--]d/file/qiyejianjie/2016-12-13/64502e6fff449ae88685bf78ba3dfbd7.jpg\\\\\" title=\\\\\"企业简介.jpg\\\\\" alt=\\\\\"企业简介.jpg\\\\\"/></span></strong></p><p style=\\\\\"text-indent: 2em; line-height: 2em;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\">黑龙江克络诺斯电子商务有限公司是“黑龙江克络诺斯企业集团”旗下从事互联网+服务的创新型电子商务平台企业。公司注册资本 6000 万元人民币，现有员工 198 人，其中具有高级网络技术职称人员 21 人，平均年龄 35 岁，全部为大学本科以上学历。公司目前在黑龙江、吉林、内蒙古、河南、山东、安徽、江苏、甘肃等省区设立分公司，并与俄罗斯等境外企业确立商贸战略合作关系，正在拓展东南、西南等省区的服务业务。公司是中国互联网协会会员单位、黑龙江省互联网协会理事单位、黑龙江省电子商务协会理事单位、黑龙江省大数据产业联盟成员单位。公司注册地址为黑龙江省哈尔滨市经济技术开发区，电子商务品牌为“聚升国际电商平台”。</span></p><p style=\\\\\"text-indent: 2em; line-height: 2em; text-align: center;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\"><img src=\\\\\"[!--news.url--]d/file/qiyejianjie/2016-12-13/be2c0335b9d644fc942c51b9b7d7e01b.jpg\\\\\" title=\\\\\"1479094448355915.jpg\\\\\" alt=\\\\\"公司简介_07.jpg\\\\\"/></span></p><p style=\\\\\"text-indent: 2em; line-height: 2em;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\">公司基本业务版块为O2O、B2C、F2C、C2C等互联网+N模式创新，业务范围涵盖国内与跨境两个市场。初创期主要致力于开发、运营面向诸多联盟商（厂）家和广大消费者的电子商务平台，运行机制为利用本平台对加盟店（厂）商的在线展示与推介，促进消费者完成与线下实体店（厂）商的消费过程，实现质优价廉的购买愿望，并通过平台的增值业务，使店（厂）商和广大消费者收获各种赠送的实惠。目前，公司集中开发、运营“实体店消费折扣赠送养老金”、“累积子女消费教育基金”、“积存消费医疗保障”等平台服务项目。</span></p><p style=\\\\\"text-indent: 2em; line-height: 2em; text-align: center;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\"><img src=\\\\\"[!--news.url--]d/file/qiyejianjie/2016-12-13/04279522a52cc19033a5741d4d1412b8.jpg\\\\\" title=\\\\\"1479094486721255.jpg\\\\\" alt=\\\\\"公司简介_11.jpg\\\\\"/></span></p><p style=\\\\\"text-indent: 2em; line-height: 2em;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\">公司以新型市场消费需求为导向，以引导消费者积极和理性消费、繁荣实体商业为目的，通过公司快捷、方便、持久、实效、增值的精诚服务，为联盟实体商（厂）家锁定客源、增加销售量，并充分满足广大消费者的购买愿望，进而实现虚拟经济和实体经济有机结合、消费与投资有效转换，推动社会经济良性循环和平衡发展。</span></p><p style=\\\\\"text-indent: 2em; line-height: 2em;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\">公司秉承诚信守信、精致精准的服务理念，坚持夯实基础、平稳运行、规范管理、防控风险的企业宗旨，树立合作共赢、润济民生的思想，实现聚合资源、升华产业、提高大众生活品质、拉动实体商业经济的目标。</span></p><p><br/></p>	\r\n            </div>\r\n        </div>\r\n    </div>\r\n       \r\n\r\n\r\n\r\n        [!--temp.footer--]\r\n</div>\r\n</body>\r\n</html>\r\n		<script>\r\n			\$(function(){\r\n					\$(window).scroll(function() {\r\n						var d1=\$(document).scrollTop();\r\n						if(d1>257){\r\n							var d2=d1-257;\r\n							\$(\\\\\".sub_l\\\\\").css(\\\\\"top\\\\\",d2);\r\n						}else{\r\n							\$(\\\\\".sub_l\\\\\").css(\\\\\"top\\\\\",0);\r\n						}\r\n\r\n					})\r\n			})\r\n		</script>\r\n','0','0','','0','0','','0','0','0','1481616822','classtemp','1','admin');");
