, SimSun; font-size: 18px;\\\\\"><strong><span style=\\\\\"font-family: 宋体, SimSun; letter-spacing: 0px;\\\\\">运作模式</span></strong></span></p><p style=\\\\\"text-indent: 2em; line-height: 2em;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\">一、会员在联盟商（厂）家累计消费满1000元（可跨行业、跨地域进行消费）可获得1个积分赠送权，满2000元获赠2个（以此类推），平台会最大限度地按相应比例以养老、医疗、教育基金以及积分兑换国内外特色产品的形式，最终以高达四折的优惠价回赠给消费者。</span></p><p style=\\\\\"text-indent: 2em; line-height: 2em;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\">联盟商（厂）家须向聚升网络服务平台缴纳的服务费=会员在此联盟商（厂）家单笔交易额的12%，而商（厂）家交纳的服务费最终会再赠送给联盟商（厂）家，相当于平台免费为商（厂）家提供服务。（备注：商（厂）家免费加盟，会员免费注册。）</span></p><p style=\\\\\"text-indent: 2em; line-height: 2em;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\">所送的600积分由以下几个方面进行分配：</span></p><p style=\\\\\"text-indent: 2em; line-height: 2em;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\">1、每周一到周五所送积分为可提现部分，占每一个积分赠送权600积分中的63.3%。（380积分左右）</span></p><p style=\\\\\"text-indent: 2em; line-height: 2em;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\">（备注：每天下午4点开始赠送，当您的可提现部分达到100元时即可申请提现。当提现时，手机会接到一个验证码，在规定的时间内，务必填写正确。如有误、延时将取消当天的提现，24小时后方可再次发起。申请成功后48小时之内到您的银行卡中，第二次提现须7天以后。）</span></p><p style=\\\\\"text-indent: 2em; line-height: 2em;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\">2、周六所送积分为线上兑换特色商品部分，占每一个积分赠送权600积分中的20%（120积分左右）。</span></p><p style=\\\\\"text-indent: 2em; line-height: 2em;\\\\\"><span style=\\\\\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\\\\\">3、周日所送积分为消费养老金填充部分，占每一个积分赠送权600积分中的16.7%（100积分左右）。</span></p><p style=\\\\\"margin: 28px 0px 0px; padding: 0px; text-indent: 2em; line-height: 1.75em;\\\\\"><br/></p>	\r\n            </div>\r\n        </div>\r\n    </div>\r\n\r\n\r\n\r\n        [!--temp.footer--]\r\n</div>\r\n</body>\r\n</html>\r\n		<sc